import React from 'react'
import styled from 'styled-components'

import svg from '../../src/assets/svg/subtract.svg'
import { ReactComponent as Tab } from '../../src/assets/svg/subtract.svg'

export const ContainerTab = styled.span`
  height: ${(props) => props.theme.navigation.height};
  background: white;
  z-index: 9999;
  position: fixed;
  bottom: 0;
`

export const TabBar = styled(Tab)`
  height: 3rem;
  width: inherit;
  display: inline-block;
  z-index: 5;
  margin: 1rem 0;
  background-color: inherit;
`
